import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AddShoplisting from './add/AddShoplisting';
import EditShoplisting from './edit/EditShopListing';
function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Welcome to the App</h1>

          {/* Buttons to navigate to Add and Edit pages */}
          <div>
            <button>
              <Link to="/add">Go to Add Page</Link>
            </button>

            <button>
              <Link to="/edit">Go to Edit Page</Link>
            </button>
          </div>
        </header>

        {/* Define Routes */}
        <Routes>
          <Route path="/add" element={<AddShoplisting />} />
          <Route path="/edit" element={<EditShoplisting />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
